		const TILE_SIZE = 512;














		function fillPolygon (poly) {
			const insideCoords = [];
			const rows = TILE_SIZE;
			const cols = TILE_SIZE;

			const ys = poly.map(({ y }) => y);
			const minY = Math.min(...ys);
			const maxY = Math.max(...ys);

			if (minY === maxY) {
				console.log('return early y')
				return insideCoords;
			}

			// second row -> second last row
			for (let r = minY + 1; r < rows - 1; r++) {
				if (r === maxY) {
					return insideCoords;
				}

				const xs = poly.filter(({ y }) => y === r).map(({ x }) => x);
				const minX = Math.min(...xs);
				const maxX = Math.max(...xs);

				if (minX === maxX) {
					return insideCoords;
				}

				let depth = -10;
				let FILLING = true;

				for (let c = minX + 1; c < cols - 1; c++) {
					const cell = poly.find(({ x, y }) => y === r && x === c);
					// if (cell) {
					// 	depth = cell.z;
					// }

					if (c === maxX) {
						break;
					}

					if (cell) {
						continue;
					}

					if (!FILLING && cell) {
						FILLING = true;
					}

					if (FILLING) {
						insideCoords.push({
							x: c,
							y: r,
							z: depth
						});
					}
				}
			}

			return insideCoords;
		}









		function drawPolygonBorders (poly) {
			function line(x0, y0, x1, y1, depth) {
				const polyLine = [];

				var dx = Math.abs(x1 - x0);
				var dy = Math.abs(y1 - y0);
				var sx = (x0 < x1) ? 1 : -1;
				var sy = (y0 < y1) ? 1 : -1;
				var err = dx - dy;

				while (true) {
					polyLine.push({
						x: x0,
						y: y0,
						z: depth
					});

					if ((x0 === x1) && (y0 === y1)) {
						break;
					}

					const e2 = 2 * err;
					if (e2 > -dy) {
						err -= dy; x0  += sx;
					}
					if (e2 < dx) {
						err += dx; y0  += sy;
					}
				}

				return polyLine;
			}

			const polyLines = [];


			for (let i = 0; i < poly.length - 1; i++) {
				const polyLine = line(poly[i].x, poly[i].y, poly[i+1].x, poly[i+1].y, poly[i].z);
				polyLines.push(polyLine);
			}
			return polyLines;
		}
